function App() {
  return (
    <Routes>
      <Route path="/" element={<Landing />} />

      <Route path="/auth" element={<Auth />}>
        <Route path="" element={<Navigate replace={true} to="login" />} />
        <Route path="login" element={<Login />} />
      </Route>
      <Route path="/admin" element={<AdminTpContent />} />
    </Routes>
  );
}

export default App;
